export const initialState={
    mainPosts: [{
        id:1,
        User: {
            id:1,
            nickname:'laon',
        },
        content: '첫 번째 게시글 #해시태그 #익스프레스',
        Images: [{
            src: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSX3j7Qr3ZPH1fSHDkfpXpZHFAL-SWI0ew_fg&usqp=CAU',
        }, {
            src: 'data:image/jpeg;base64,'
        }, {
            src: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTuUjubkCFJVNUrpWlMYXjvuftHjfW40z62Eg&usqp=CAU'
        }],
        Comments: [{
            User:{
                nickname: 'hero',
            },
            content: '얼른 사고싶어요'
        }]
    }],
    imagePaths: [],
    postAdded: false,
}

const ADD_POST = 'ADD_POST';
export const addPost = {
    type: ADD_POST,
}
const dummyPost = {
    id: 2,
    content: '더미데이터입니다.',
    User: {
        id: 1,
        nickname: '제로초',
    },
    Images: [],
    Comments: [],
}
const reducer = (state = initialState, action) => {
    switch(action.type) {
        case ADD_POST:
            return {
                ...state,
                mainPosts: [dummyPost, ...state.mainPosts],
                postAdded: true,
            }
        default:
            return state;
    }
};

export default reducer;
